import { StyleSheet } from "react-native";

const styles = StyleSheet.create({

    container: {
      backgroundColor: '#fff',
      flexDirection:'column',
    },

    containerh:{
        width:'100%',
        height:'5%',
        backgroundColor:'#3e4',


    },
    containerf:{
        justifyContent:'flex-end',
        width:'100%',
        height:'5%',
        backgroundColor:'#3e4',


    },
  
  
  });

  export default styles;
